const puppeteer = require("puppeteer");
const CustmorModel = require("../Model/CustmorModel");
const MyServiceModel = require("../Model/ServiceModel");

// Function to generate PDF invoice using Puppeteer
const generatePDF = async (saleData) => {
  return new Promise(async (resolve, reject) => {
    try {
      // Fetch customer details
      const customer = await CustmorModel.findById(saleData.customer);
      // Fetch services details
      const services = await MyServiceModel.find({
        _id: { $in: saleData.services },
      }).populate("serviceName");

      const htmlContent = `<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tax Invoice</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 20px;
            background-color: #f4f4f4;
        }
        .invoice {
            background: #fff;
            padding: 20px;
            max-width: 800px;
            margin: auto;
            border: 1px solid #ddd;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }
        .header {
           display: flex;
           margin-bottom: 20px;
           justify-content: space-between;
        }
        .header h1 {
            margin: 0;
            font-size: 24px;
        }
        .header p {
            margin: 5px 0;
            font-size: 14px;
        }
        .header img {
            max-width: 50px;
            margin-top: 10px;
        }
        .bill-to, .invoice-details {
            margin-bottom: 20px;
            font-size: 14px;
        }
        .bill-to, .invoice-details {
            width: 100%;
            margin-bottom: 10px;
        }
        .bill-to p, .invoice-details p {
            margin: 5px 0;
        }
        .bill-to {
            float: none;
            text-align: left;
        }
        .invoice-details {
            float: none;
            text-align: left;
        }
        @media(min-width: 600px) {
            .bill-to {
                float: left;
                width: 48%;
            }
            .invoice-details {
                float: right;
                width: 48%;
                text-align: right;
            }
        }
        .clear {
            clear: both;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 20px;
            font-size: 14px;
        }
        table, th, td {
            border: 1px solid #ddd;
        }
        th, td {
            padding: 8px;
            text-align: left;
        }
        th {
            background: #f4f4f4;
        }
        tfoot{
            font-weight: 700;
        }
        .terms {
            font-size: 12px;
            margin-top: 20px;
        }
        .footer {
            text-align: center;
            margin-top: 20px;
        }
        .footer .sign {
            margin-top: 40px;
        }
        .qr-code {
            float: none;
            text-align: center;
            margin-top: 10px;
        }
        @media(min-width: 600px) {
            .qr-code {
                float: left;
                text-align: left;
            }
        }
    </style>
</head>
<body>
    <div class="invoice">
        <div class="header">
            <div>
                <h1>DELIGHT R.O POINT</h1>
                <p>Shop No 47 A Pradhan Chowk Sadhnagar Palam Colony New Delhi 110045</p>
                <p>Phone no.: +91 9318610690 | Email: mi200194@gmail.com</p>
            </div>
            <div>
                <img src="data:image/jpeg;base64," alt="logo" width="100">
            </div>
        </div>
        <div style="text-align: center; margin-bottom: 20px;">
            <h2>Tax Invoice</h2>
        </div>
        <div class="bill-to">
            <p><strong>Bill To:</strong></p>
            <p>${customer.customerName} UID ${customer.customerId}</p>
            <p>${customer.address}</p>
            <p>Contact No: ${saleData.mobileNumber}</p>
        </div>

        <div class="invoice-details">
            <p><strong>Invoice Details:</strong></p>
            <p>Invoice No: ${saleData.billNo}</p>
            <p>Date: ${new Date(saleData.createdAt).toLocaleDateString()}</p>
            <p>Time: ${new Date(saleData.createdAt).toLocaleTimeString()}</p>
        </div>

        <div class="clear"></div>

        <table>
            <thead>
                <tr>
                    <th>Item Name</th>
                    <th>Quantity</th>
                    <th>Price/unit</th>
                    <th>Discount</th>
                    <th>Amount</th>
                </tr>
            </thead>
            <tbody>
                ${services
                  .map(
                    (service) => `
                  <tr>
                      <td>${service.serviceName?.serviceNames || "N/A"}</td>
                      <td>${service.quantity || "N/A"}</td>
                      <td>${service.rate || "N/A"}</td>
                      <td>${service.discount || "0"} (${
                      service.serviceName?.discountPercentage || "N/A"
                    }%)</td>
                      <td>${service.totalAmount || "N/A"}</td>
                  </tr>
              `
                  )
                  .join("")}

            </tbody>
            <tfoot>
                <tr>
                    <td>Total</td>
                    <td colspan="2">${saleData.totalQuantity}</td>
                    <td>${saleData.totalDiscount}</td>
                    <td>${services.reduce(
                      (n, { totalAmount }) => n + +totalAmount,
                      0
                    )}</td>
                </tr>
            </tfoot>
        </table>

        <table>
            <tr>
                <td>Sub Total</td>
                <td>${saleData.subfinaltotal}</td>
            </tr>
            <tr>
                <td>Discount</td>
                <td>${saleData.totalDiscount}</td>
            </tr>
            <tr>
                <td>Total</td>
                <td><strong>${saleData.totalAmount}</strong></td>
            </tr>
            <tr>
                <td>Invoice Amount In Words</td>
                <td><strong>${convertNumberToWords(
                  saleData.totalAmount
                )} Only</strong></td>
            </tr>
            <tr>
                <td>Received</td>
                <td>${saleData.reciveAmount}</td>
            </tr>
        </table>

        <div class="terms">
            <p><strong>Terms And Conditions:</strong></p>
            <ol>
                <li>One Year MFG Defect</li>
                <li>Electrical item Warranty</li>
                <li>All Service Pre Filter Chargable</li>
                <li>Installation 350 & Service 150</li>
                <li>Late payment Charge 300</li>
                <li>Sold goods will not be returned.</li>
                <li>Warranty will not cover wear and tear.</li>
            </ol>
        </div>

        <div class="footer">
            <div class="qr-code">
                <p>Scan to Pay</p>
                <img src="data:image/jpeg;base64," alt="QR Code" width="100">
            </div>

            <div class="sign">
                <p>For: DELIGHT R.O POINT</p>
                <img src="data:image/jpeg;base64," alt="Signature" width="100">
                <p>________________________</p>
                <p>Authorized Signatory</p>
            </div>
        </div>
    </div>
</body>
</html>
`;

      // Launch puppeteer
      const browser = await puppeteer.launch();
      const page = await browser.newPage();

      // Set content to page
      await page.setContent(htmlContent, { waitUntil: "load" });

      // Generate PDF buffer
      const pdfBuffer = await page.pdf({ format: "A4" });

      // Close browser after PDF generation
      await browser.close();

      resolve(pdfBuffer);
    } catch (error) {
      reject(error);
    }
  });
};

// Utility function to convert numbers to words (for invoice amount)
const convertNumberToWords = (num) => {
  // Simplified conversion for demonstration
  return "Ten Rupees and Eight Paise";
};

module.exports = {
  generatePDF,
};
